import React from 'react';
import Footer from '../../Footer';
import '../../../App.css';
import Slideshow from './Slideshow';
import product_info from './product_info,js';


function Hearth_bracelet_gold() {
  return (
    <>
      <Slideshow />
      <product_info />
      <Footer />
    </>
  );
}

export default Hearth_bracelet_gold;
